func gcPropForRune(r rune) gcProp {
	if r < 256 {
		return gcAsciiLookupTbl[r]
	}

	i, j := 0, len(gcRanges)
	for i < j {
		mid := i + (j-i)/2
		rng := gcRanges[mid]
		if rng.Start <= r && r <= rng.End {
			return rng.Prop
		} else if r < rng.Start {
			j = mid
		} else {
			i = mid + 1
		}
	}
	return gcPropNone
}
